import React from 'react';
import './index.css';

import Div from './Div';
function App() {
  return (
    <React.Fragment>
    <h1 className="heading">Welcome to My Playlist!</h1>
    <Div className="imag" imgs="./img/download.jpeg" para= "MS Dhoni : The untold Story" link="https://www.hotstar.com/in/movies/ms-dhoni-the-untold-story/1770003314/watch"/>
  <Div className="imag" imgs="./img/half.jpeg" para= "Half Girlfriend" link="https://www.netflix.com/title/80192420"/>

  <Div className="imag" imgs="./img/str.jpg" para= "Stree" link="https://www.netflix.com/title/81113921"/>
</React.Fragment>
  );
}

export default App;
